import React from "react";
import {StyleSheet, TextInput, View} from "react-native";

export default function Resultado(){

    
    <View style={styles.resultado}>

        <TextInput
        placeholder = "Resultado Suma"
        keyboardType = "numeric"
        style = {styles.input}
        editable = {false}
        onChange = {(e) => setNum1(e.nativeEvent.text)}
        />

        <TextInput
        placeholder = "Resultado resta"
        keyboardType = "numeric"
        style = {styles.input}
        editable = {false}
        onChange = {(e) => setNum1(e.nativeEvent.text)}
        />
        
        <TextInput
        placeholder = "Resultado Multiplicacion"
        keyboardType = "numeric"
        style = {styles.input}
        editable = {false}
        onChange = {(e) => setNum1(e.nativeEvent.text)}
        />
        
        <TextInput
        placeholder = "Resultado Division"
        keyboardType = "numeric"
        style = {styles.input}
        editable = {false}
        onChange = {(e) => setNum1(e.nativeEvent.text)}
        />
        
    </View>
 
    const styles = StyleSheet.create({
        resultado:{
            marginTop: 100
          }
    });
}
